import React, { Component } from 'react'
import Tour from '../Tour/Tour' 
import {tourData} from '../../tourData'
export default class Tourlist extends Component {
    constructor(props) {
        super(props);
        this.state = {tours : tourData};
    }
    render() {
        const {tours} = this.state
        console.log(tours);
        return (
          <section>
            {tours.Map((tour) => (
              <Tour></Tour>
            ))}
          </section>
        );
    }
}
